{
	var u_ajax_url = '../?fc=module&module=ultimateimagetool&controller=ajax';
}
else
{
	var u_ajax_url = uit_module_path;
}



function trigger_product_regenerate_images(image_typer, convert)
{




		if( product_start == 0 )
			return false;


		 if (convert === undefined) {
		       convert = false;
		    }

		 if(!convert)
		 {
		 	var action = 'regenerate_product_images';
		 	var quality = jQuery('#image_quality').val() ;
		 }
		 else
		 {
		 	var action = 'convert_product_images';
		 	var quality = jQuery('#image_quality_convert').val() ;
		 }
		 	

		var max_products = parseFloat(jQuery('#products_max').html());
  		var response_z = $.ajax({ 
  			type: "POST",   
  			method: 'POST',
			url:  u_ajax_url,
			dataType : 'html',
			cache: false,
			data: {  action: action,   image_type: image_typer, image_quality: quality  }, 
			async: true,
			success: function(msg) {

				var  obj = JSON.parse(msg);
				 			var image_typer2  = image_typer;
					 		if(convert == true)
					 		{
					 			image_typer2 = image_typer + '_convert';
					 		}


				 if(obj.is_end == 0)
				 {
				 		setTimeout(function(){ 


				 			var category_current = parseFloat(jQuery('.type_'+image_typer2).find('.category_current').text());

				 			if(category_current <  obj.offset)
				 			{
					 			if(convert == false)
					 				jQuery('.type_'+image_typer2).find('.saved_after').text(obj.saved_after + ' Kb');

					 			jQuery('.type_'+image_typer2).find('.category_current').text(obj.offset);
								
								var progress_with = parseFloat(obj.offset) / parseFloat(jQuery('.type_'+image_typer2+' #hidden_product_total').val()) * 100;
								jQuery('.type_'+image_typer2).find('.ui-progressbar-value').attr('style', 'width:' + progress_with + '%');				 	

								if(obj.json){
									var json =  JSON.parse(uit_unescape(obj.json));
									if(json)
									{
										if(json.error)
										{
											if(json.error == 401)
												$.notify(json.error_long+'. Contact your hosting and ask them to allow https://resmush.it image compression service to download the images.', "error");
										}
									}
								}
							


				 			}
				 			setTimeout(function(){ 
						 		trigger_product_regenerate_images(image_typer, convert);	
						 	 }, 300);		

					 	 }, 300);				 		
				 }
				 else
				 {
				 	jQuery('.type_'+image_typer2).find('.ui-progressbar-value').attr('style', 'width:100%');
					jQuery('.type_'+image_typer2).find('.category_current').text(jQuery('.type_'+image_typer2+' #hidden_product_total').val());
				 }
				
				return;
			}
		}).responseText;

}


