	function regenerate_image_size()
	{

		var regenerate_type = jQuery('#regenerate_type').val();
		var regenerate_size = jQuery('#regenerate_size').val();

		var response_z = $.ajax({ 
  			type: "POST",   
  			method: 'POST',
			url:  u_ajax_url,
			dataType : 'html',
			cache: false,
			data: {  action: 'regenerate_image_sizes',   regenerate_type: regenerate_type, regenerate_size: regenerate_size, offset: regeneration_offset}, 
			async: true,
			error: function(msg){  regeneration_offset++; },
			success: function(msg) {
				if(msg.length > 0)
				{
					obj = JSON.parse(msg);

					if(obj.error == 0)
					{
						regeneration_offset++;
						jQuery('#uit_regenerate .category_current').text(regeneration_offset);
						jQuery('#uit_regenerate #categories_max').text(obj.total_products);
						var progress_with = parseFloat(regeneration_offset) / parseFloat(obj.total_products) * 100;
						jQuery('#uit_regenerate .ui-progressbar-value').attr('style', 'width:' + progress_with + '%');			
						regenerate_image_size();
					}
					else
					{
						regeneration_offset = 0;
						jQuery('.regenerate_image_sizes').fadeIn();
					}
				}
				else
				{
					jQuery('.regenerate_image_sizes').fadeIn();
				}
				return;
			}
		}).responseText;
	}
