	jQuery('body').on('click','.switch_logs', function(){



		var val = jQuery(this).attr('page');

  		var response_z = $.ajax({ 
  			type: "POST",   
  			method: 'POST',
			url:  u_ajax_url,
			dataType : 'html',
			cache: false,
			data: {  action: 'get_logs',   val: val }, 
			async: true,
			success: function(msg) {

				obj = JSON.parse(msg);

				var html = '';
				var inner = '';

				obj.forEach(function(product, index) {

					var y = 'yes';
					if(product.process == 0)
						y = 'no';

					img = '<a href="'+product.image+'" target="_blank"><img height="40" width="40" src="'+product.image+'" /></a>';
					if(product.image == false)
						img = '';
					inner = '<tr class="process_'+product.process+'"><td><font><font>'+product.id+'</font></font></td><td><a href="'+product.link+'" target="_blank">'+product.id_product+'</a></td><td>'+img+'</td><td> '+product.image_size+'</td><td>'+product.original_size+' Kb</td><td>'+product.new_size+' Kb</td><td>'+y+'</td><td>'+product.date_add+'</td></tr>';
					html += inner;
				});

				jQuery('.logs_inner').html(html);


				return;
			}
		}).responseText;




		return false;	
	});




