	function delete_image()
	{

		var type = jQuery('#delete_type').val();
		var size = jQuery('#delete_size').val();

		if(type.length == 0 || size.length == 0)
		{
			alert('You must select a valid image type');
			return false;
		}

		var response_z = $.ajax({ 
		  			type: "POST",   
		  			method: 'POST',
					url:  u_ajax_url,
					dataType : 'html',
					cache: false,
					data: {  action: 'delete_images',   type: type, size: size, offset: delete_offset  }, 
					async: true,
					success: function(msg) {
						var  obj = JSON.parse(msg);
			
					

						 if(obj.error == 1)
						 {
							var html = '<div class="alert alert-success"><h4>Images have been deleted</h4></div>';
							$('.type_delete').html(html);
						 }
						 jQuery('.type_delete').removeClass('hidden');

						setTimeout(function(){ 
								jQuery('.type_delete').addClass('hidden');
							 }, 5000);	

						return;
					}
				}).responseText;


	}



		var typingTimer;
		var doneTypingInterval = 500; 
		var $input = $('#alt_syntax');

		//on keyup, start the countdown
		$input.on('keyup', function () {
		  clearTimeout(typingTimer);
		  typingTimer = setTimeout(doneTyping, doneTypingInterval);
		});

		//on keydown, clear the countdown 
		$input.on('keydown', function () {
		  clearTimeout(typingTimer);
		});

		//user is "finished typing," do something
		function doneTyping () 
		{

			var val  = $('#alt_syntax').val();
	  		var response_z = $.ajax({ 
	  			type: "POST",   
	  			method: 'POST',
				url:  u_ajax_url,
				dataType : 'html',
				cache: false,
				data: {  action: 'update_alt_syntax',   val: val  }, 
				async: true,
				success: function(msg) {
					
						var  obj = JSON.parse(msg);

						 if(obj.is_end == 1)
						 {
							var html2 = '<div class="alert alert-success"><h4>Image alt tags format updated !</h4></div>';
							$('.uit_altsyntax_html').html(html2);
						 }
						 jQuery('.uit_altsyntax_html').removeClass('hidden');

						setTimeout(function(){ 
								jQuery('.uit_altsyntax_html').addClass('hidden');
							 }, 5000);	


					return;
				}
			}).responseText;

		}


